/* [id ja, id nee, "vraag"] */
const questions = [
	/*0*/[-1, 1, "Is het een plantje met bladeren en zit het vast in de grond?"],
	/*1*/[2, 0, "Heeft de plant bloemen?"],
	/*2*/[3, 6, "Zijn de bloemen blauw of paars?"],
	/*3*/[-2, 4, "Bloem met helpje (bolle 'bovenlip') en onderlip (lipbloemige), eerder paars dan blauw. Stengel vierkantig, vaak kruipend. Niervormige bladeren staan twee aan twee tegenover elkaar?", 4, -2],
	/*4*/[-3, 5, "Bloemen piepklein (2-3 mm), verstopt tussen kleinee bladeren en helderblauw?"],
	/*5*/[-4, 0, "Bloemen klein (4-8 mm), lichtpaars, goedzichtbaar, met iets donkerder paarse nerven?"],
	/*6*/[0,0, "Zijn de bloemen helemaal geel?"]
]
export default questions;
